import { useEffect, useState } from "react";

function Home() {
  const [data, setData] = useState([
    {
      title: "شسيب",
      job: "Frontend",
      info: "شيب",
      id: 1,
    },
    {
      title: "هل الحياة جميلة ؟",
      job: "Back End",
      info: " نعم ولم لا انها شيء لا يتكرار مرتين",
      id: 2,
    },
    {
      title: "this is me Q",
      job: "Back End",
      info: "it's a good Q",
      id: 3,
    },
    {
      title: "this is me RR",
      job: "Back End",
      info: "it's a good JT",
      id: 4,
    },
  ]);

  useEffect(() => {
    console.log(data[0].job);
  }, []);

  return (
    <div className="Home ">
      <h1 className="text-4xl my-4">All Respes</h1>
      <div className="cards flex flex-wrap">
        {data.map((rsp) => (
          <div className="card w-96 bg-success  text-success-content m-3" key={rsp.id}>
            <div className="card-body">
              <h2 className="card-title">{rsp.title}</h2>
              <p>{rsp.info}</p>
              <span className="badge">{rsp.job}</span>
              <div className="card-actions justify-end">
                <button className="btn">Check it</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
